    false,nt"url": null,nt"notes": "This 1985-86 Annual Migratory Waterfowl
    Hunting Program outlines the reasons and regulations for migratory waterfowl hunting
    on Parker River National Wildlife Refuge.  Populations of migratory waterfowl on
    the refuge during State designated hunting seasons are of sufficient numbers that
    there is a harvestable surplus.  Refuge hunting areas are sufficiently segregated
    from high general public use areas to eliminate conflicts with non-hunting visitors.
     Permits are required, and hunters may not use or possess more than 25 shells per
